            See the Pen <a href='https://codepen.io/stw/pen/KEoLaV/'>KEoLaV</a> by Stu
            (<a href='https://codepen.io/stw'>@stw</a>) on <a href='https://codepen.io'>CodePen</a>.
        </iframe>
      </div>
    )
}


export default CodePenCard;
